      if (lookahead == ')') ADVANCE(154);
      if (lookahead == '*') ADVANCE(171);
      if (lookahead == '+') ADVANCE(173);
      if (lookahead == ',') ADVANCE(146);
      if (lookahead == '-') ADVANCE(174);
